var boxPlotData = [];
var barPlotData = [];

var races = ["African American", "American Indian / Alaska Native", "Asian / Pacific Islander", "Caucasian", "Hispanic", "Other/Unknown"];
for(var i = 0; i < 6; i++){
    var group = races[i];
    for(var j = 0; j < 25; j++){
        boxPlotData.push({
            group: group,
            age: parseInt(25+(Math.random()*(55-25))), //Compute a random age between 25 and 55
            gender: parseInt((Math.random()*2)) === 0 ? 'male' : 'female'
        });
    }
    for(j = 0; j < 3; j++){
        boxPlotData.push({
            group: group,
            age: parseInt(75+(Math.random()*(95-75))), //Compute a random age between 75 and 95
            gender: parseInt((Math.random()*2)) === 0 ? 'male' : 'female'
        });
    }
    for(j = 0; j < 3; j++){
        boxPlotData.push({
            group: group,
            age: parseInt(1+(Math.random()*(16-1))), //Compute a random age between 1 and 16
            gender: parseInt((Math.random()*2)) === 0 ? 'male' : 'female'
        });
    }

    for(var j = 0; j < 25; j++){
        barPlotData.push({
            group: group,
            age: parseInt(1+(Math.random()*(12))), //Compute a random age between 0 and 12
            gender: parseInt((Math.random()*2)) === 0 ? 'male' : 'female'
        });
    }
}

var groupedBoxData = LABKEY.vis.groupData(boxPlotData, function(row){return row.group});
var medianLineData = [];

for(var groupName in groupedBoxData){
    var stats = LABKEY.vis.Stat.summary(groupedBoxData[groupName], function(row){return row.age});
    medianLineData.push({x: groupName, y:stats.Q2, color: 'median'});
}

var scatterData = [];
for(var i = 0; i < 1000; i++){
    var point = {
        x: i % 9 == 0 ? null : parseInt((Math.random()*(150))),
        y: Math.random() * 1500,
        z: parseInt(Math.random()*125),
        ptid: i % 20,
        isSelected: false
    };
    scatterData.push(point);
}

